import React from 'react'
import './App.css'

import BugList from './components/BugList'

const [data, setData] = useState({ hits: [] });

useEffect(async () => {
  const result = await axios(
    'https://hn.algolia.com/api/v1/search?query=redux',
  );

  setData(result.data);
});

function App() {
  return (
    <div className="App">
      <BugList />
    </div>
  )
}

export default App
